import React from "react";
import { UilUtensils } from "@iconscout/react-unicons";
import { UilApps } from "@iconscout/react-unicons";
import { UilPalette } from "@iconscout/react-unicons";
import { UilShoppingCartAlt } from "@iconscout/react-unicons";
import { UilRainbow } from "@iconscout/react-unicons";
import { UilUnamused } from "@iconscout/react-unicons";

const Home = () => {
  return (
    <div className="main--home--container">
      <div className="home--grid--box">
        <div className="menu--box">
          <UilUtensils />
        </div>
        <div className="venueBooking--box">
          <UilApps />
        </div>
        <div className="supportArtwork--box">
          <UilPalette />
        </div>
        <div className="supportMicroBusiness--box">
          <UilShoppingCartAlt />
        </div>
        <div className="rainbowCentre--box">
          <UilRainbow />
        </div>
        <div className="donation--box">
          <UilUnamused />
        </div>
      </div>
    </div>
  );
};

export default Home;
